import React, { useState } from "react";
import Data from "./components/APIData";
// import Navbar from "./components/Navbar";
// import Vote from "./components/Vote";
// import CampaignCards from "./components/CampaignCards";
// import Heading from "./components/Heading";
import "./App.css";
// import TrackTransactions from "./components/TrackTransactions";
function App() {
  const [data, setData] = useState([{ from: "", to: "", value: "" }]);
  function fetchTransactionData() {
    fetch(
      "https://api.etherscan.io/api?module=account&action=txlist&address=0x98388199AeC4c7489b92b09C630fDb022102a429&startblock=0&startblock=0&page=1&offset=10&sort=asc&apikey=NV73WQ1VR3QCXY2K1WYGVRA1VHY8521D1V"
    )
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        // console.log(data)
        const listItems = data.result.map((element)=>{
          return (
            <ul>
              <li>{element.from}</li>
              <li>{element.to}</li>
              <li>{element.value}</li>
            </ul>
          )
        })
        setData(data.result);
        return(
          <div>
            {listItems}
          </div>
        )
      });
  }
  return (
    <div className="App">
      <section>
        <button onClick={fetchTransactionData}>GET TRANSACTIONS</button>
      </section>
      <Data apiData={data} />
      {/* <Navbar />

      <Vote />
      <Heading />
      <CampaignCards />
      <CampaignCards />
      <CampaignCards /> */}
      {/* <CampaignCards />
      <CampaignCards />
      <CampaignCards />
      <CampaignCards /> */}
      {/* <TrackTransactions /> */}
    </div>
  );
}
export default App;
